import jsPDF from "jspdf";
import autoTable from 'jspdf-autotable'

export const attachment = 'נספח';
const description = 'פירוט';
const page = 'עמוד';

export const downloadPdfDocument = (data = [], options = {onlyTable: false}) => {
    const pdf = new jsPDF({
        unit: "px"
    });
    pdf.setR2L(true);
    pdf.setFont("Alef_Regular");
    addTable(pdf, data);
    if (!options.onlyTable) {
        addAttachments(pdf, data);
    }
    pdf.save((options.fileName || 'download') + ".pdf");
}

function addTable(pdf, data) {
    const d = [];
    data.forEach((it) => {
        d.push([
            `${it.end} - ${it.start}`,
            it.description,
            it.pos
        ])
    })
    autoTable(pdf, {
        head: [[page, description, attachment]],
        body: d,
        theme: "grid",
        styles: {
            font: 'Alef_Regular',
            halign: "center",
            fontSize: "12"
        },
        headStyles: {
            fillColor: '#333'
        }
    })
}

function addAttachments(pdf, data) {
    data.forEach((d, idx) => {
        pdf.addPage();
        const options = {
            maxWidth: 300,
            baseline: 'bottom',
            align: 'center'
        }
        pdf.setFontSize(36);
        var pageHeight = pdf.internal.pageSize.height || pdf.internal.pageSize.getHeight();
        var pageWidth = pdf.internal.pageSize.width || pdf.internal.pageSize.getWidth();

        pdf.text(d.pos, pageWidth / 2, pageHeight / 2, options, null, "center");

        pdf.setFontSize(20);
        pdf.text(d.description, pageWidth / 2, (pageHeight / 2) + 20, options, null, "center");
    })
}


(function (jsPDFAPI) {
    var font = `
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    
    `;
    var callAddFont = function () {
        this.addFileToVFS('Alef_Regular-normal.ttf', font);
        this.addFont('Alef_Regular-normal.ttf', 'Alef_Regular', 'normal');
    };
    jsPDFAPI.events.push(['addFonts', callAddFont])
})(jsPDF.API);